import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import GitData from './route/GitData';



ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
    <Routes>
      <App />
      <Route path="GitData" element={<GitData />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
